import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import React, {useState} from "react";
import { Form, Input, Checkbox, Button, Col } from "antd";
import { Layout, Row, Divider } from 'antd';
const {Header, Content, Footer} = Layout;

const columns = [
    {
        title: "Mã sản phẩm",
        dataIndex: "MaSP",
        key: "MaSP"
    },
    {
        title: "Số lượng",
        dataIndex: "TinhTrang",
        key: "TinhTrang"
    },
    {
        title: "Giá tiền",
        dataIndex: "TongTien",
        key: "TongTien"
    },
    {
        title: "Mã NVGH",
        dataIndex: "MaNVGH",
        key: "MaNVGH"
    }
]

const SpTrongKho = () => {
    const [listSP, setListSP] = useState([]);

    useEffect(() => {
      axios
        .get("http://localhost:5000/api/NVQL/dssp/" + JSON.parse(window.localStorage.getItem("NVQL")))
        .then((res) => {
            setListNV(res.data);
        })
        .catch((err) => {
          console.log(err);
        });
    }, []);
    return(
    <div>
            <Layout>
                <Content>
                    <Title level={2} classname="titlename">
                    Danh sách đơn hàng
                    </Title>
                    <Table columns={columns} dataSource={listNV}/>
                </Content>
            </Layout>
    </div>
    );
}
export default SpTrongKho;
